import React from "react";
import QuoteSection from "../Components/QuoteSection";
import './styles/Home.css';
import image from "../Components/images/logo-full.png";

function Home() {
  return (
    <div className="home-page">
      <img></img>
      <QuoteSection />
    </div>
  );
}

export default Home;
